My First Sex Teacher - Zoey Holloway 


Released : June 13, 2011

Johnny's teacher Ms. Holloway left her job and he's helping her bring her books home. She tells him she'll be available for some tutoring sessions, but when he's about to leave she also tells him that since she's not his teacher anymore, there's something else that's available: her. She begins the tutoring session immediately, with a blowjob, and ends it with a chin full of jizz.
